import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";
import SectionContainer from "../../shared/components/SectionContainer";
import theme from "../../shared/theme";
import mediaQueries from "../../shared/media-queries";

const Content = styled.div`
  display: flex;
  padding: 5rem 1rem;
  overflow: hidden;
  float: left;
  flex-wrap: wrap;
`;

const Phonenumber = styled.div`
  display: flex;
  @media ${mediaQueries.tablet("max")} {
    width: 50%;
  }
`;
const GitHub = styled.div`
  display: flex;
  line-height: 1.4rem;
  @media ${mediaQueries.tablet("max")} {
    width: 50%;
  }
`;
const BitBucket = styled.div`
  display: flex;
  @media ${mediaQueries.tablet("max")} {
    width: 50%;
  }
`;

const Contact = styled.div`
  display: flex;

  justify-content: flex-end;
  @media ${mediaQueries.tablet("max")} {
    width: 50%;
  }
`;

const StyledLink = styled(Link)`
  outline: none;
  border: none;
  background: none;
  cursor: pointer;
  color: ${theme.colors.yellow.main};
  font-weight: bold;
`;
const Footer = () => {
  return (
    <Content>
      <Phonenumber>0739- 48 52 13</Phonenumber>
      <GitHub>
        <StyledLink to="https://github.com/nauberinho">GitHub</StyledLink>
      </GitHub>
      <BitBucket>
        <StyledLink target="_blank" to="https://github.com/nauberinho">
          BitBucket
        </StyledLink>
      </BitBucket>
      <Contact>niklas.nauber@hotmail.com</Contact>
    </Content>
  );
};

export default Footer;
